import React from 'react';
import { Menu, Segment, Header, Grid,Container } from 'semantic-ui-react';

export default function Head() {
  const navData = ['Home', 'Pokemon', 'About Me'];
  const menu = navData.map((item, i) => {
    return (
      <Menu.Item key={i} name={item} as='a'>
        {item}
      </Menu.Item>
    );
  });
  return (

      <Menu secondary  pointing style={{ margin: 0, fontSize:15 }}>
        {menu}
        <Grid>
        <Grid.Column floated='right' >
          <Header as='h1' color='red' >
            Pokemon
          </Header>
        </Grid.Column>
      </Grid>
      </Menu>


  );
}
